import React from 'react';
import Question from '../components/Question';
import {useParams} from "react-router-dom";

function questionID() {

    const {id} = useParams();
    return (
        <div className="flex justify-center w-full">

            <p>{id}</p>

            <Question />

        </div>
    )
}

export default questionID
